import './App.css';
import './article'
function Print() {
  return <h1>Hello World</h1>;
}

function UserCard() {
  const user = {
    name: "Alice Dupont",
    age: 38,
    job: "Développeuse Web",
    location: "Paris, France"
  };

  return (
    <div className="result">
      <p>Nom : {user.name}</p>
      <p>Age : {user.age}</p>
      <p>Job : {user.job}</p>
      <p>Location : {user.location}</p>
      {user.age<30?<p> jeune </p>:<p>vieux</p>}
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <div className="header">
        <Print />
        <UserCard />
        <Pr/>
      </div>
    </div>
  );
}

export default App;
